import { Component } from "react";

class CardList extends Component {
  render() {
    console.log("render !!!");
    const { linuxHosts } = this.props;

    return (
      <div className="card-list">
        {linuxHosts.map((eachHost) => (
          <div className="card-container" key={eachHost.id}>
            <img
              alt={`host ${eachHost.name}`}
              src={`https://static.vecteezy.com/system/resources/thumbnails/005/146/551/small/personal-computer-pixel-art-vector.jpg`}/>
              <h2>{eachHost.name}</h2>

          </div>
        ))}
      </div>
    );
  }
}

export default CardList;
